import React from "react";
import { Box, Typography } from "@mui/material";
import propic from "./files/alyssa.jpg";
import "./styles/App.css";
import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
  root: {
    display: "flex",
    flexDirection: "column",
    height: "70vh",
    alignItems: "center",
    justifyContent: "center",
  },
  title: {
    backgroundColor: "#24305E",
    color: "white",
    padding: "10px",
  },
  text: {
    display: "flex",
    justifyContent: "center",
  },
  link: {
    "&hover": {
      color: "white",
    }
  },
});

function App() {
  const classes = useStyles();

  return (
    <Box className={classes.root}>
      <img id="profile-pic" src={propic} alt="Alyssa Wang"></img>
      <Box className="typewriter" sx={{ marginBottom: "10px" }}>
        <Typography variant="h3" className={classes.title}>
          ALYSSA WANG
        </Typography>
      </Box>
      <Typography className={classes.text}>
        SWE at
        <a href="https://www.mitre.org/" target="_blank" className={classes.link}>
          {"\u00A0"}MITRE
        </a>
      </Typography>
      <Typography className={classes.text}>
        <a href="https://www.williams.edu/" target="_blank">
          Williams College
        </a>
        {"\u00A0"}'20
      </Typography>
      <Typography className={classes.text}>
        <a href="https://csci.williams.edu/" target="_blank">
          Computer Science{"\u00A0"}
        </a>
        •
        <a href="https://comp-lit.williams.edu/" target="_blank">
          {"\u00A0"}Comparative Literature
        </a>
      </Typography>
      <Typography className={classes.text}>
        <a href="https://github.com/AlyssaWang" target="_blank">
          Github{"\u00A0"}
        </a>
        •
        <a href="https://linkedin.com/in/alyssacwang" target="_blank">
          {"\u00A0"}LinkedIn
        </a>
      </Typography>
    </Box>
  );
}

export default App;
